  false,\n\t\"url\": null,\n\t\"notes\": \"This data set shows polygons of average
  annual precipitation in New York State, for the climatological period 1961-1990.
  Parameter-elevation Regressions on Independent Slopes Model (PRISM) derived raster
  data is the underlying data set from which the polygons and vectors were created.
  PRISM is an analytical model that uses point data and a digital elevation model
  (DEM) to generate gridded estimates of annual, monthly and event-based climatic
  parameters.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"temporal-extent-begin\",\n\t\t\"value\":
